export const Questions = [
  {
    prompt: "What is the correct command to create a new React project?",
    optionA: "npx create-react-app",
    optionB: "npm create-react-app",
    optionC: "npx create-react-app myReactApp",
    optionD: "npm create-react-app myReactApp",
    answer: "C",
  },
  {
    prompt: "What does myReactApp refer to in the following command?",
    optionA: "The directory to create the new app in",
    optionB: "A reference to an existing app",
    optionC: "The type of app to create",
    optionD: "The name you want to use for the new app ",
    answer: "D",
  },
  {
    prompt: "What command is used to start the React local development server?",
    optionA: "npm serve",
    optionB: "npm run dev",
    optionC: "npm start",
    optionD: "npm build",
    answer: "C",
  },
  {
    prompt: "To develop and run React code, Node.js is required.",
    optionA: "True",
    optionB: "False",
    answer: "A",
  },
  {
    prompt: "What is the children prop?",
    optionA: "A property that lets you nest components in other components",
    optionB: "A property that lets you pass data to child components",
    optionC: "A property that lets you set an object as a property",
    optionD: "A property that adds child values to state",
    answer: "A",
  },
];
